-- -----------------------------------------------------------------------------------------------
-- Criação da tabela TIPO_DFE
-- -----------------------------------------------------------------------------------------------

CREATE TABLE TIPO_DFE
(TPDF_ID INTEGER NOT NULL,
TPDF_TIPO INTEGER,
TPDF_SIGLA TEXT NOT NULL,
TPDF_DESCRICAO TEXT NOT NULL,
TPDF_INICIO_VIGENCIA TEXT NOT NULL,
TPDF_FIM_VIGENCIA TEXT DEFAULT NULL CHECK ("TPDF_FIM_VIGENCIA" IS NULL OR "TPDF_FIM_VIGENCIA" >= "TPDF_INICIO_VIGENCIA"),
PRIMARY KEY (TPDF_ID));

-----------------------------------------------------------------------------------------
-- Carga de dados da tabela TIPO_DFE
-----------------------------------------------------------------------------------------














-- -----------------------------------------------------------------------------------------------
-- Criação da tabela TIPO_DFE_CLASSIFICACAO
-- -----------------------------------------------------------------------------------------------

CREATE TABLE TIPO_DFE_CLASSIFICACAO
(TDCL_ID INTEGER NOT NULL,
TDCL_CLTR_ID INTEGER NOT NULL,
TDCL_TPDF_ID INTEGER NOT NULL,
TDCL_INICIO_VIGENCIA TEXT NOT NULL,
TDCL_FIM_VIGENCIA TEXT DEFAULT NULL CHECK ("TDCL_FIM_VIGENCIA" IS NULL OR "TDCL_FIM_VIGENCIA" >= "TDCL_INICIO_VIGENCIA"),
FOREIGN KEY (TDCL_CLTR_ID) REFERENCES CLASSIFICACAO_TRIBUTARIA(CLTR_ID),
FOREIGN KEY (TDCL_TPDF_ID) REFERENCES TIPO_DFE (TPDF_ID),
PRIMARY KEY (TDCL_ID));

